BlocklyGamesMsg["Pond.helpUseScan"] = "Ihe ngwọta gị na-arụ ọrụ, ma i nwere ike ime nke ọma karịa. Jiri 'Nyocha' iji kọọrọ egbe ọkụ ahụ ókè ọ ga agbaa.";
BlocklyGamesMsg["Pond.helpText1"] = "Jiri iwu 'egbe ọkụ' kụọ ebumnuche. Nkebi nke mbụ bụ akuku ahụ, nkebi nke abụọ bụ ókè. Chọta ezi nchikota.";
BlocklyGamesMsg["Pond.helpText2"] = "Ee kwesịrị ịkụ ebumnuche a ọtụtụ ugboro. Jiri 'mgbe (ezịokwụ)' gburugburu iji ime ihe ruo mgbe ebighị ebi.";
BlocklyGamesMsg["Pond.helpText3a"] = "Onye iro a na-aga n'ihu ma na-azụ, na-eme ka ọ sie ike ịkụ. Nziputa 'nchoputa' weghachiri ókè kmpomkwem nye onye iro na ntughari aka akapịrị ọnụ.";
BlocklyGamesMsg["Pond.helpText3b"] = "Ókè nke a bụ kpọmkwem ihe iwu kwesịrị 'egbe ọkụ' iji gba ọkụ n'ụzọ ziri ezi.";
BlocklyGamesMsg["Pond.helpText4"] = "Onye iro a dị nnọọ anya iji egbe ọkụ ahụ (nke nwere oke nke mita 70). Kama nke ahụ, jiri iwu 'igwu mmiri' mee ka ị malite igwu mmiri ga n'akụkụ onye iro ahụ ma daba na ya.";
BlocklyGamesMsg["Pond.helpText5"] = "Onye iro a dịkwa oke anya iji egbe ọkụ ahụ. Mana ịsighi ike ịlanarị nkukota. Gwuo ga n'akụkụ onye iro ahụ mgbe ebe akara gị dị ala karịa 50. Mgbe ahụ, 'kwụsị' ma jiri egbe ọkụ ahụ.";
BlocklyGamesMsg["Pond.helpText6"] = "Onye iro a ga-apụ mgbe a kụrụ ya. Gwuru mmiri ga n'akụkụ ya ma ọ bụrụ na ọ dị n’ókè n’erụghị (mita 70).";
